Here is a JavaScript function that takes an array of 5 numbers as input and checks if any of the numbers are prime. If a prime number is found, it will be printed to the console.

```javascript
function checkPrime(arr) {
    if (arr.length !== 5) {
        console.error("Array should contain exactly 5 numbers.");
        return;
    }

    for (let i = 0; i < arr.length; i++) {
        let num = arr[i];
        if (num < 2) continue; // numbers less than 2 are not prime

        for (let j = 2; j <= Math.sqrt(num); j++) {
            if (num % j === 0) {
                // not prime
                break;
            }
        }

        // if the loop finished without finding a factor, the number is prime
        if (j > Math.sqrt(num)) {
            console.log(num);
        }
    }
}

// Example usage:
let numbers = [17, 2, 3, 13, 19];
checkPrime(numbers);
```

This function first checks if the array has exactly 5 numbers. Then it iterates through the array, checks if the number is less than 2 (since 2 is the smallest prime number), and if it is, it skips to the next number.

For each number, it checks if there is a factor between 2 and the square root of the number. If it finds a factor, it breaks the loop and moves on to the next number. If it doesn't find a factor, the number is prime, and it logs the number to the console.
